    setIsOpen(!isOpen);
  };

  const sortProducts = (criteria) => {
    const sortedProducts = [...details];

    if (criteria === "price") {
      sortedProducts.sort((a, b) => {
        if (sortOrder === "asc") {
          return a.price - b.price;
        } else {
          return b.price - a.price;
        }
      });
    }
    // else if (criteria === "review") {
    //   sortedProducts.sort((a, b) => {
    //     if (sortOrder === "asc") {
    //       return a.review - b.review;
