                type="button"
                className="text-wrapper-5"
                onClick={toggleOptions}
                value="Sort"
              />
              <div className="options-dropdown">
                <input
                  type="button"
                  className={`sort-options price-up ${isOpen ? "visible" : ""}`}
                  value="price-up"
                  onClick={() => {
                    setSortCriteria("price");
                    setSortOrder("asc");
                    sortProducts("price");
